import "../../css/pages/pages.css";
import { useEditProfile } from "../../hooks/user/useEditProfile";
export const ProfilePage = (props) => {
  const {
    targetWorkTime,
    targetWakeTime,
    targetBedTime,
    onChangeTargetWorkTime,
    onChangeTargetWakeTime,
    onChangeTargetBedTime,
    onEditTargetTime,
  } = useEditProfile();
  return (
    <section className="page">
      <div className="page-input-box">
        <h1>Profile Page</h1>
        <span className="profile-text">TargetWorkTime</span>
        <input
          value={targetWorkTime}
          type="number"
          className="page-input-box__input page-input-box__input-username"
          onChange={({ target: { value } }) => onChangeTargetWorkTime(value)}
        />

        <span className="profile-text">TargetWorkTime</span>
        <input
          value={targetWakeTime}
          className="page-input-box__input page-input-box__input-email"
          type="number"
          placeholder="TargetWakeTime"
          onChange={({ target: { value } }) => onChangeTargetWakeTime(value)}
        />
        <span className="profile-text">TargetWorkTime</span>
        <input
          value={targetBedTime}
          type="number"
          className="page-input-box__input page-input-box__input-password"
          placeholder="TargetBedTime"
          onChange={({ target: { value } }) => onChangeTargetBedTime(value)}
        />
        <button
          className="page-input-box__btn page-input-box__btn-login"
          onClick={onEditTargetTime}
        >
          Save
        </button>
      </div>
    </section>
  );
};
